/**
 * The Class DeviceConfig.
 */
public class DeviceConfig {
	
	/** The name. */
	private String name;
	
	/** The id. */
	private String id;// Android - List of device has to prioritize
	
	/** The udid. */
	private String udid;// IOS
	
	/** The type. */
	private String type;
	
	/**
	 * Gets the name.
	 *
	 * @return the name
	 */
	public String getName() {
		return name;
	}
	
	/**
	 * Sets the name.
	 *
	 * @param name the new name
	 */
	public void setName(String name) {
		this.name = name;
	}
	
	/**
	 * Gets the id.
	 *
	 * @return the id
	 */
	public String getId() {
		return id;
	}
	
	/**
	 * Sets the id.
	 *
	 * @param id the new id
	 */
	public void setId(String id) {
		this.id = id;
	}
	
	/**
	 * Gets the udid.
	 *
	 * @return the udid
	 */
	public String getUdid() {
		return udid;
	}
	
	/**
	 * Sets the udid.
	 *
	 * @param udid the new udid
	 */
	public void setUdid(String udid) {
		this.udid = udid;
	}
	
	/**
	 * Gets the type.
	 *
	 * @return the type
	 */
	public String getType() {
		return type;
	}
	
	/**
	 * Sets the type.
	 *
	 * @param type the new type
	 */
	public void setType(String type) {
		this.type = type;
	}
	
	

}
